import React from "./node_modules/react";
const ToggleButton = ({
  children,
  disabled,
  className,
  fullWidth,
  ...otherProps
}) => {
  return (
    <button
      disabled={disabled}
      className={className}
      fullWidth={fullWidth}
      {...otherProps}
    >
      {children}
    </button>
  );
};

export default ToggleButton;
